(164, 286, ' Message Box ', 'message-box', '<p>Add dismiss functionality to all alert messages with this plugin.</p>\r\n<div class="bs-docs-example">\r\n[message_box type="error" close="Yes"]<strong>ERROR !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="info" close="Yes"]<strong> INFO !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="warning" close="Yes"]<strong>WARNING !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="success" close="Yes"]<strong>SUCCESS !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;message_box type="error"   close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="info"    close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="warning" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="success" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n<div class="bs-docs-example">\r\n[message_box title="Oh snap! You got an error!" type="error" close="Yes"]\r\nChange this and that and try again. Duis mollis, est non commodo luctus, nisi erat porttitor ligula,\r\neget lacinia odio sem nec elit. Cras mattis consectetur purus sit amet fermentum.\r\n[/message_box]\r\n\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;message_box title=''MESSAGE_TITLE'' type="error" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n</pre>', '', 1, 90, '2013-02-21 23:07:00', 537, '', '2013-04-01 06:57:03', 42, 0, '0000-00-00 00:00:00', '2013-02-21 23:07:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fullt