(165, 287, 'Social Buttons', 'social-buttons', '[message_box type="warning" close="no"]\r\n<p>Ex: element type="facebook" then name of icons is "fa-facebook".</p>\r\nYou can find the full examples of usage at Font Awesome - <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.1.0</a> \r\n[/message_box]\r\n\r\n<div class="bs-docs-example">\r\n<p>\r\n[social type="facebook" title="Facebook Fllow Us" ] #[/social]\r\n[social type="twitter" ]#[/social]\r\n[social type="google-plus"]#[/social]\r\n[social type="pinterest" ]#[/social]\r\n[social type="dribbble" ]#[/social]\r\n\r\n[social type="flickr" title="Follow us on Flickr"]#[/social]\r\n[social type="linkedin" title="Follow us on Linkedin"]#[/social]\r\n[social type="rss" title="Follow us on Rss"]#[/social]\r\n[social type="skype" title="Follow us on Skype"]#[/social]\r\n[social type="youtube" title="Follow us on Youtube"]#[/social]\r\n\r\n</p>\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;social type="facebook"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="twitter"&#93; PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="google-plus"&#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="pinterest"&#93;       PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="dribbble"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n&#91;social type="flickr" title="ADD_TITLE_HERE" &#93;  PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="linkedin" title="ADD_TITLE_HERE" &#93;     PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="rss" title="ADD_TITLE_HERE" &#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="skype" title="ADD_TITLE_HERE" &#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="youtube" title="ADD_TITLE_HERE" &#93; PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n</pre>\r\n\r\n<!----------------------- Block space Min-------------------->\r\n\r\n<div class="bs-docs-example">\r\n[social type="facebook" style="min"]#[/social]\r\n[social type="twitter" style="min"]#[/social]\r\n[social type="google-plus"  style="min"]#[/social]\r\n[social type="pinterest" style="min"]#[/social]\r\n[social type="dribbble" style="min"]#[/social]\r\n[social type="flickr" style="min"]#[/social]\r\n[social type="linkedin" style="min"]#[/social]\r\n[social type="rss" style="min"]#[/social]\r\n[social type="skype" style="min"]#[/social]\r\n[social type="youtube" style="min"]#[/social]\r\n\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;social type="facebook" style="min"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="twitter" style="min"&#93; PLACE_LINK_HERE &#91;/social&#93;\r\n...\r\n</pre>\r\n\r\n\r\n<!----------------------- Block space cicle-------------------->\r\n<div class="bs-docs-example">\r\n[social type="facebook" style="cicle"]#[/social]\r\n[social type="twitter" style="cicle"]#[/social]\r\n[social type="google-plus"  style="cicle"]#[/social]\r\n[social type="pinterest" style="cicle"]#[/social]\r\n[social type="dribbble" style="cicle"]#[/social]\r\n[social type="flickr" style="cicle"]#[/social]\r\n[social type="linkedin" style="cicle"]#[/social]\r\n[social type="rss" style="cicle"]#[/social]\r\n[social type="skype" style="cicle"]#[/social]\r\n[social type="youtube" style="cicle"]#[/social]\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;social type="facebook" style="cicle"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="twitter" style="cicle"&#93; PLACE_LINK_HERE &#91;/social&#93;\r\n...\r\n</pre>\r\n\r\n<!----------------------- Block space flat-------------------->\r\n<div class="bs-docs-example">\r\n[social type="facebook" style="flat" color="Yes"]#[/social]\r\n[social type="twitter" style="flat" color="Yes"]#[/social]\r\n[social type="google-plus"  style="flat" color="Yes"]#[/social]\r\n[social type="pinterest" style="flat" color="Yes"]#[/social]\r\n[social type="dribbble" style="flat" color="Yes"]#[/social]\r\n[social type="flickr" style="fl