(176, 299, 'FAQ', 'faq', '<h5 class="title">Got Questions? We’ve Got Answers!</h5>\r\n<p>Asunt in anim uis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in anim id est laborum. Allamco laboris nisi ut aliquip ex ea commodo consequat. Aser velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in anim id est laborum.</p>\r\n<p>[space height=''20'']</p>\r\n<div class="row">\r\n<div class="col-sm-8 first">[accordion] [acc_item title="I do not have a Paypal account. Do you support other payment methods?"] Yes! You can pay through all of payment gateways that Paypal or 2Checkout supports including all major types of Credit cards. Visit Paypal and 2Checkout for more information. [/acc_item] [acc_item title="How can I join the SmartAddons Club for Products?"]\r\n<p><strong> Please try to do steps: </strong></p>\r\n[list type="smallnumber5"]\r\n<ul>\r\n<li>Click "Join Now", select the membership package and make your payment via Paypal or 2Checkout. Our "Special Offers" and "Promotions" also come at this page.</li>\r\n<li>If your payment is successful, login details to access the Member Download Area will be sent to your email and you can start downloading instantly. This process normally takes less than 5 minutes.</li>\r\n</ul>\r\n[/list] [/acc_item] [acc_item title="Which Joomla! membership package is the best for me?"]\r\n<p><strong> You are recommended to register the following packages as they will bring to you the best benefits: </strong></p>\r\n[list type="star"]\r\n<ul>\r\n<li>Joomla Template Club - Business License</li>\r\n<li>Joomla Template Club - Developer License</li>\r\n<li>Joomla Extension Club - Business License</li>\r\n<li>Joomla Extension Club - Developer License</li>\r\n</ul>\r\n[/list] [/acc_item] [acc_item title="How much does it cost?"] We have many Membership Packages for you to choose. Each package has different prices, durations and number of Supported domain. The membership duration starts instantly from the moment you make payment and receive login details from smartaddons.com. Visit our <b> <a href="../../register.html">Join Now</a></b> Page to view the various memberships available for the products with details.[/acc_item] [acc_item title="SmartAddons membership fee is one-time fee, or I have to pay extra?"] When your membership is expired, you can still use all our templates, extensions downloaded during your membership period without paying any extra fee. However, in order to continue downloading our new/update/upgrade templates/extensions or access to Download area, you should renewal your membership. [/acc_item] [/accordion]</div>\r\n<div class="col-sm-4">\r\n<h3>[icon name="envelope" size="20" color="#666" ] One More Question?</h3>\r\n<p>Asunt in anim uis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in anim id est laborum. Allamco laboris nisi ut aliquip ex ea commodo consequat. Aser velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in anim id est laborum.</p>\r\n<p><a class="button " href="#" target="_blank" rel="slides[buttonlightbox]"><strong>Get in Touch</strong></a></p>\r\n</div>\r\n</div>', '', 1, 91, '2013-02-25 04:45:21', 537, '', '2014-05-09 08:54:32', 754, 0, '0000-00-00 00:00:00', '2013-02-25 04:45:21', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_pa