(218, 459, 'Services 2', 'services-2', '<div id="g-pageservices">\r\n<p>We provide professional services to small and medium sized businesses as well as to larger companies in Europe and abroad. Specialising in Web Development, we have helped many businesses make their online appearance and interactive campaigns a success. We are specialized in following services.</p>\r\n[space height=''20'']\r\n<div class="row features">\r\n<div class="col-sm-4">[icon name="flask" align="left" size="39" color="#fff"]\r\n<article>\r\n<h3>Easy To Customize</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n<div class="col-sm-4">[icon name="cutlery" align="left" size="34" color="#fff"]\r\n<article>\r\n<h3>Ready to Use</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n<div class="col-sm-4">[icon name="tablet" align="left" size="42" color="#fff"]\r\n<article>\r\n<h3>Responsive Design</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n\r\n<div class="col-sm-4 first">[icon name="search" align="left" size="32" color="#fff"]\r\n<article>\r\n<h3>Search Engines (SEO)</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n<div class="col-sm-4">[icon name="globe" align="left" size="46" color="#fff"]\r\n<article>\r\n<h3>Web Marketing</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n<div class="col-sm-4">[icon name="twitter" align="left" size="32" color="#fff"]\r\n<article>\r\n<h3>Social Media</h3>\r\n<p>Aliquam lacinia mi elit, ut accumsan orci. Ut nisl lorem, pharetra vitae sagittis non, commodo id orci. Sed interdum elit a mi ultricies ac lobortis tellus venenatis</p>\r\n\r\n</div>\r\n</div>\r\n<hr />\r\n<h2>What we are?</h2>\r\n<div class="b-block">[lightbox src="images/bonus_page/a1.jpg" width="320" height="210" lightbox="off" title="Vestibulum id urna" align="left" ]\r\n<article>\r\n<h3>Cras eget congue arcu.</h3>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec purus nibh, commodo ac pellentesque quis, vehicula ut leo. Suspendisse potenti. Sed rhoncus est ac arcu malesuada bibendum. Cras ut nisi id lacus aliquam sodales posuere egestas elit. Quisque sodales pulvinar dolor eu facilisis. Proin in feugiat nisi.</p>\r\n[list type="check"]\r\n<li>Donec feugiat purus eget ipsum</li>\r\n<li>pulvinar at vestibulum faucibus</li>\r\n<li>Aliquam aliquam consequat laoreet</li>\r\n<li>Curabitur eget sapien sem</li>\r\n<li>Vestibulum mattis felis a ante</li>\r\n[/list]</article>\r\n</div>\r\n<hr />\r\n<h2>What clients say</h2>\r\n<div class="row">\r\n<div class="col-sm-4">[testimonial style="red" author="Alycia E. Kelly" position="Kelly Financial Group" avatar="images/bonus_page/avatar-1.jpg" ] Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin scelerisque, augue porttitor bibendum facilisis [/testimonial]</div>\r\n<div class="col-sm-4">[testimonial style="blue" author="Alycia E. Kelly" position="Kelly Financial Group" avatar="images/bonus_page/avatar-2.jpg" ] Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin scelerisque, augue porttitor bibendum facilisis [/testimonial]</div>\r\n<div class="col-sm-4">[testimonial style="oranges" author="Alycia E. Kelly" position="Kelly Financial Group" avatar="images/bonus_page/avatar-3.jpg" ] Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin scelerisqu