(66, 'test shortcode', 'test-shortcode', 9, 1, '<p>This module displays the latest registered users. <a href="http://help.joomla.org/proxy/index.php?option=com_help&amp;keyref=Help16:Extensions_Module_Manager_Latest_Users">Help</a></p>\r\n<div> </div>\r\n<div>[playerlist]<br />    [player_item src="http://kolber.github.io/audiojs/demos/mp3/04-islands-is-the-limit.mp3" single="Dead wrong intro" author="Wait What"]<br />    [player_item src="http://kolber.github.io/audiojs/demos/mp3/01-dead-wrong-intro.mp3" single="Juicy-r" author="Wait What"]<br />    [player_item src="http://kolber.github.io/audiojs/demos/mp3/01-dead-wrong-intro.mp3" single="islands is the limit" author="Wait What"]<br />[/playerlist]</div>\r\n<div> </div>', '', NULL, NULL, NULL, '', '2011-01-01 00:00:01', 558, 'Joomla!', 0, '0000-00-00 00:00:00', '2014-08-06 16:54:45', 558, '2011-01-01 00:00:01', '0000-00-00 00:00:00', 1, 1, 3, 0, 0, '', '', '', '', 129, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","itemRating":"","itemImage":"","itemImgSize":"","itemImageMainCaption":"","itemImageMainCredits":"","itemIntroText":"","itemFullText":"","itemExtraFields":"","itemDateModified":"","itemHits":"","itemCategory":"","itemTags":"","itemAttachments":"","itemAttachmentsCo