(129, 'Module Variations', 'module-variations', 9, 1, '<p><strong> Enter any available suffixes at Extensions - Module Manager - Module - Module Class Suffix. </strong></p>\r\n<p>This template''s module system comes with a wide range of module styles, color variations, badges and icons. Below you can see which module styles come with color variations and with which badges and icons you can combine them.Here is a list of the available options:</p>\r\n<table class="variations">\r\n<tbody>\r\n<tr class="odd">\r\n<td class="bold">Box</td>\r\n<td>box1, box2, box3</td>\r\n</tr>\r\n<tr>\r\n<td class="bold">Bg</td>\r\n<td>bg1, bg2, bg3, bg4</td>\r\n</tr>\r\n<tr class="odd">\r\n<td class="bold">Icons</td>\r\n<td>tablet, cogs, phone.vv.. You can find the full icons of usage at <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.0.3 </a></td>\r\n</tr>\r\n<tr>\r\n<td class="bold">Other</td>\r\n<td>blank, menu</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', '', NULL, NULL, NULL, '', '2011-06-29 03:31:50', 558, '', 0, '0000-00-00 00:00:00', '2014-05-02 10:26:35', 754, '2011-06-29 03:31:50', '0000-00-00 00:00:00', 1, 1, 4, 0, 0, '', '', '', '', 1752, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemImageGalleryAnchor":"","itemCommentsAnchor":"","item