(183, 'What''s new?', 'what-s-new', 91, 1, '<div id="g-pagewhatnew">\r\n<p>[message_box title="New UI for backend template" type="info" show_close="Yes"]From the YT Framework v2, we support UI for backend of template. We hope this will bring to you the best gratification.[/message_box]</p>\r\n<p>[message_box title="Renew, add new params" type="info" show_close="Yes"] With this version, you will get many renewing, many new added params.[/message_box]</p>\r\n<p>[message_box title="Support shortcodes, bonus pages" type="info" show_close="Yes"]From the YT Framework v2, we will support shortcodes and bonus pages. Let <a href="index.php?option=com_content&amp;view=article&amp;id=179&amp;Itemid=648">click here </a>for more info. [/message_box]</p>\r\n<h3 class="title">YT v2 screenshot</h3>\r\n[columns background="none"] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/overview-desc.jpg" title="Template info &amp; desc" data-rel="prettyPhoto"><img src="images/yt/screenshot1.png" border="0" /></a></div>\r\n<h5 class="align-center">Template info &amp; desc</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/overview-version.jpg" title="Template version &amp; Framework version" data-rel="prettyPhoto"><img src="images/yt/screenshot2.png" border="0" /></a></div>\r\n<h5 class="align-center">Template version &amp; Framework version</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/layout-setting.jpg" title="Layout setting" data-rel="prettyPhoto"><img src="images/yt/screenshot3.png" border="0" /></a></div>\r\n<h5 class="align-center">Layout setting</h5>\r\n[/column_item] [/columns] [columns background="none"] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/menu-setting.jpg" title="Menu setting" data-rel="prettyPhoto"><img src="images/yt/screenshot4.png" border="0" /></a></div>\r\n<h5 class="align-center">Menu setting</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/theme-setting.jpg" title="Theme setting" data-rel="prettyPhoto"><img src="images/yt/screenshot5.png" border="0" /></a></div>\r\n<h5 class="align-center">Theme setting</h5>\r\n[/column_item] [column_item col="4"]\r\n<div class="yt-lightbox curved  image-none  "><a href="images/yt/special-pos.jpg" title="Use special position" data-rel="prettyPhoto"><img src="images/yt/screenshot6.png" border="0" /></a></div>\r\n<h5 class="align-center">Use special position</h5>\r\n[/column_item] [/columns]\r\n<h3 class="title">Main Features</h3>\r\n<ul class="yt-list type-check" style="color: #6b82a2;">\r\n<li>Typography</li>\r\n<li>Shortcodes</li>\r\n<li>Bonus page</li>\r\n<li>Support cpanel</li>\r\n<li>Multiple Themes</li>\r\n<li>Responsive web design</li>\r\n<li>Integrate Bootstrap</li>\r\n<li>Support RTL/LTR language</li>\r\n<li>100% table-less design, using html5 css3</li>\r\n<li>Mega Menu, moo menu, dropline menu, css menu</li>\r\n<li>Joomla! 1.7 Joomla! 2.5 and Joomla! 3.0 Native</li>\r\n<li>Support Module Variations, set style for each module</li>\r\n<li>Multiple Layouts, support override layout for many menu item</li>\r\n<li>W3C XHTML 1.0 Transitional Valid; Optimize CSS/JS/HTML/Merge File</li>\r\n<li>Compatible with IE8+, Firefox 2+, Flock 0.7+, Netscape, Safari, Opera 9.5 and Chrome</li>\r\n</ul>\r\n</div>', '', NULL, NULL, NULL, '', '2013-03-09 08:05:17', 558, '', 0, '0000-00-00 00:00:00', '2013-05-23 10:44:01', 42, '2013-03-09 08:05:17', '0000-00-00 00:00:00', 1, 1, 3, 0, 0, '', '', '', '', 291, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catIte