(199, 'On scroll animations', 'on-scroll-animations', 91, 1, ' <p>In the SJ Plus v2 template we have implemented the animation engine based on the <a target="_blank" href="http://julianlloyd.me/scrollreveal/">scrollReveal.js script</a>. This script makes creating elements onscroll animations very simple to define.</p>\r\n\r\n<p>Thanks to this script you can describe an animation using natural language.</p>\r\n\r\n<p>Description of the animation is placed in the <strong>data-scroll-reveal</strong> attribute:</p>\r\n\r\n<pre>&lt;!-- These 3 lines are equivalent --&gt;\r\n&lt;div data-scroll-reveal="enter left and move 50px over 1.33s"&gt; Foo &lt;/div&gt;\r\n&lt;div data-scroll-reveal="enter from the bottom after 1s"&gt; Bar &lt;/div&gt;\r\n&lt;div data-scroll-reveal="wait 2.5s and then ease-in-out 100px"&gt; Baz &lt;/div&gt;\r\n</pre>\r\n\r\n<p>The full description of the syntax is available on the project <a target="_blank" href="https://github.com/julianlloyd/scrollReveal.js">documentation page</a></p>   		              		            ', '', NULL, NULL, NULL, '', '2014-07-31 12:05:20', 558, '', 0, '0000-00-00 00:00:00', '2014-07-30 14:13:55', 558, '2014-07-31 12:05:20', '0000-00-00 00:00:00', 1, 1, 0, 0, 0, '', '', '', '', 22, '{"catItemTitle":"","catItemTitleLinked":"","catItemFeaturedNotice":"","catItemAuthor":"","catItemDateCreated":"","catItemRating":"","catItemImage":"","catItemIntroText":"","catItemExtraFields":"","catItemHits":"","catItemCategory":"","catItemTags":"","catItemAttachments":"","catItemAttachmentsCounter":"","catItemVideo":"","catItemVideoWidth":"","catItemVideoHeight":"","catItemAudioWidth":"","catItemAudioHeight":"","catItemVideoAutoPlay":"","catItemImageGallery":"","catItemDateModified":"","catItemReadMore":"","catItemCommentsAnchor":"","catItemK2Plugins":"","itemDateCreated":"","itemTitle":"","itemFeaturedNotice":"","itemAuthor":"","itemFontResizer":"","itemPrintButton":"","itemEmailButton":"","itemSocialButton":"","itemVideoAnchor":"","itemI