(194, 400, 'For using stickyPanel positions', '', '<p>Special positions are: stickyPanel, stickyBar, You can use them for any module type. For using this, please go to Module Manager and config your module to your desired position.\r\n</p>\r\n<p><strong>You can control module by:</strong></p>\r\n<ul class="yt-list type-smallnumber4">\r\n<li>Go to Administrator » Template Manager » Your_Template » Tab: Tools utilities » Use Sticky SlidePanel (no/left/right)\r\n</li>\r\n<li>Go to Administrator » Module magager » Your_Module(by postion: stickyPanel)\r\n</li>\r\n</ul>', 1, 'stickyPanel', 558, '2015-02-26 03:48:29', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"  @bullhorn","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
