(199, 398, 'For customize module in special position', '', '<p>The solution is using Module Class Suffix. You can customize button, module content follow Module Class Suffix</p>\r\n<p>E.g. Module Class Suffix: @<strong>bullhorn</strong> then:<br />- Class of button is ''fa-<strong>bullhorn</strong>''<strong>. </strong>If without @<strong>... </strong>the default is ''fa-pushpin''</p>', 1, 'stickyPanel', 537, '2015-04-24 08:58:26', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"@info","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
